import React, { useState ,useEffect} from 'react';
import {Link} from "react-router-dom"
import s from "../css/nav.module.css"
import logo from "../../img/logo.png"
import { useDispatch } from 'react-redux';
import { buscarPokemon } from '../../Redux/actions';
const Nav = () => {

const [search, setSearch] = useState('');
 const dispatch = useDispatch()

const handleChange=(e)=>{
    setSearch(e.target.value)
}

 const handleSubmit=(e)=>{
    e.preventDefault();
    dispatch(buscarPokemon())
} 
    return ( 
    <div className={s.contenedorNav}>
        <nav className={s.nav}>
            <Link to={"/home"}>
            <img className={s.logo} src={logo}></img>
            </Link>
            <form className={s.form} onSubmit={handleSubmit}>
                <input className={s.buscador} placeholder="Buscar Pokemon.." value={search} onChange={handleChange} />
                <button className={s.submit} type="submit"> Buscar</button>
            </form>
            <div>
                < Link className={s.linkCrear} to={"/create"}>Crea tu Pokemon!</Link>
            </div>
        </nav>
    </div>
    );
}
 
export default Nav;
